import { createApp } from 'vue/dist/vue.esm-bundler';
import App from './components/App.vue';
import AppDescription from './components/Description.vue';
import AppGame from './components/Game.vue';
import AppMenu from './components/Menu.vue';
import * as VueRouter from 'vue-router';
import axios from 'axios';
import VueAxios from 'vue-axios';
import FrontOffice from './scripts/FrontOffice';
import BackOffice from './scripts/BackOffice'; //import Login from './scripts/Login'

const weekday = {
  Monday: 1,
  Tuesday: 2,
  Wednesday: 3,
  Thursday: 4,
  Friday: 5,
  Saturday: 6,
  Sunday: 7
};
Object.freeze(weekday);
const app = createApp(App);
const routes = [{
  path: '/',
  component: AppMenu
}, {
  path: '/description',
  component: AppDescription
}, {
  path: '/game',
  component: AppGame
}, {
  path: '/services',
  component: {
    template: FrontOffice.template.default
  }
}, {
  path: '/administration',
  component: {
    template: BackOffice.template.default
  }
} //{ path: '/login', component: {template: Login.template.default} }
];
const router = VueRouter.createRouter({
  history: VueRouter.createWebHistory(),
  routes
});
axios.defaults.baseURL = "http://localhost:8081";
axios.defaults.headers = {
  'Content-Type': 'application/json'
};
app.use(VueAxios, axios);
app.use(router);
export default {
  app,
  router,
  weekday
};
app.mount('#app');
